export default class Room{

    constructor(roomCode, roomName, admin) { 
        this.roomCode = roomCode;
        this.roomName = roomName;
        this.admin = admin;
        this.data = {
            roomCode: roomCode,
            roomName: roomName,
            admin: admin
        }
    }

    newRoom(room){
        this.data = room;
        this.roomCode = room.roomCode;
        this.roomName = room.roomName;
        this.admin = room.admin;
    }
}
